import React from 'react';
import burger from '../../icons/burger.svg';
import closeButton from '../../icons/close-button.svg';
import css from './BurgerBtn.module.css'; // Make sure to import your CSS module

export default function BurgerBtn({ setOpenedModal, openedModal }) {
  return (
    <button
      onClick={() => setOpenedModal(!openedModal)}
      className={css.burgerButton}
    >
      {openedModal ? (
        <img src={closeButton} alt="Close Menu" />
      ) : (
        <img src={burger} alt="Open Menu" width={33} height={33} />
      )}
    </button>
  );
}
